  return (
    <div>
      <p className="emoji">ðŸ’–</p>
      <p className="date">29 / 01 / 20</p>
      <style jsx global>{`
        html {
          height: 100%;
          width: 100%;
          overflow: hidden;
        }

        body {
          margin: 0;
          padding: 1rem 2rem;
          background: #a8c0ff; /* fallback for old browsers */
          background: -webkit-linear-gradient(to right, #a8c0ff, #3f2b96); /* Chrome 10-25, Safari 5.1-6 */
          background: linear-gradient(to right, #a8c0ff, #3f2b96);
          color: white;
          display: flex;
          justify-content: center;
          align-items: center;
          height: 100%;
        }

        p {
          margin: 0;
          font-size: 75px;
          text-align center;
          max-width: 100%;
        }

        .date {
          border: 1px solid white;
          padding 0.5rem 1rem;
        }

        .emoji {
          position: absolute;
          font-size: 25px;
          padding: 0;
          top: 45.5%;
          transform: translateY(-50%);
          left: 0;
          right: 0;
          margin: auto;
        }

        .fail {
          padding: 5rem 0 0;
          margin: 0 auto;
          font-size: 20px;
          position: relative;
          width: 200px;
        }

        .fail::after {
          text-align: center;
          position: absolute;
          height: 5px;
          opacity: 0.7;
          width: 100%;
          bottom: 0;
          left: 0;
          content: '';
          background-color: black;
          z-index: -1;
        }
      `}</style>
    </div>
  )
}
